import React from "react";
import { Card, CardBody } from "reactstrap";


const Header = () => {
    return (
        <div>
            <Card>
                <CardBody>
                    <h1>Welcome to Course Application </h1>
                </CardBody>
            </Card>
        </div>
    )
}

export default Header
